注目度No.1の「天然石」シリーズ。人気の2種類をゴージャスに仕上げました。
オニキスは、持ち主の意志を強くさせ、正しい判断力、他人の悪意を跳ね返す「自己防衛の石」と呼ばれます。紫金石は、感情や心を安定させ、 落ち着かせてくれる働き、目標に向けて 達成することが多いようです。


ステンレスは硬質な素材であるため、アクセサリーとしては不向きとされてきましたが近年の加工技術の進歩で、今ではジュエリー業界で最も注目されているアクセサリーとされています。それにくわえて、アレルギー性の極めて低い素材で、金属アレルギーをおこしにくく、人体にとても優しい素材です。ステンレスのデザインだからこそモードスタイル～カジュルスタイルまで幅広く使える。着け心地の軽い仕上がりで大人の輝きを手に入れることが出来ます。※１点の販売価格です。ペア（セット）の価格ではありません。

<br>
<br>
【サイズ】<br>トップ：(約)縦4.0cm×横3.0cm<BR> レディースチェーン：45cm<BR> メンズチェーン：50cm<br>
      【規格】<br>素材：ジュエリーステンレス：黒瑪瑙（オニキス）又は、紫金石<br>
