人気の天然石2種！オニキスは、持ち主の意志の力を強くさせ、正しい判断力を与え、他人の悪意を跳ね返して身を守る「自己防衛の石」。ローズクオーツは、無条件の愛をテーマにした、愛と美の星「ヴィーナス」を象徴し、女性の美を輝かせ、恋の成就に絶大な効果を発揮するとされます。新しい出会いとチャンスを与えてくれ、精神的な潤いをもたらし、愛を大切に育てるパワーを吹き込んでくれるでしょう。結婚へと発展させたいと願う人にもおすすめの石です。


ステンレスは硬質な素材であるため、アクセサリーとしては不向きとされてきましたが近年の加工技術の進歩で、今ではジュエリー業界で最も注目されているアクセサリーとされています。それにくわえて、アレルギー性の極めて低い素材で、金属アレルギーをおこしにくく、人体にとても優しい素材です。ステンレスのデザインだからこそモードスタイル～カジュルスタイルまで幅広く使える。着け心地の軽い仕上がりで大人の輝きを手に入れることが出来ます。※１点の販売価格です。ペア（セット）の価格ではありません。

<br>
<br>
【サイズ・容量】<br>トップ：(約)縦4.0cm×横1.0cm（バチカン含む）<BR> レディースチェーン：45cm<BR> メンズチェーン：50cm<br>
