水晶部分には昇龍が彫られており、全体の印象を高級に魅せてくれ、シンプルで飽きのこないデザインです。
"ラピスラズリ"とは、邪気を退けるパワーと自身の心の邪念も退けるといわれます。"タイガーアイ"とは、邪心を見抜き邪悪な力を跳ね返る「邪気払い」の波動を持つとされています。


ステンレスは硬質な素材であるため、アクセサリーとしては不向きとされてきましたが近年の加工技術の進歩で、今ではジュエリー業界で最も注目されているアクセサリーとされています。それにくわえて、アレルギー性の極めて低い素材で、金属アレルギーをおこしにくく、人体にとても優しい素材です。ステンレスのデザインだからこそモードスタイル～カジュルスタイルまで幅広く使える。着け心地の軽い仕上がりで大人の輝きを手に入れることが出来ます。※１点の販売価格です。ペア（セット）の価格ではありません。

